import React, { useEffect } from 'react'
import axios from 'axios';

export const Order = () => {
    const response = () => {
        axios.get('https://pasd-webshop-api.onrender.com/api/order/', {
        headers: {
            'accept': 'application/json',
            'x-api-key': '4sqmKzToVkUoTsVfze4X'
        }
    }).then(res => {response = res.data}
    );
}
    return (
        <div>
            <h1>{response}</h1>
        </div>
    )
}
